bool MapLayer::init()
{
	Size visibleSize = Director::getInstance()->getVisibleSize();
	//float scale = Director::getInstance()->getContentScaleFactor();

	map1 = Sprite::create("stage1Back.png");
	map2 = Sprite::create("stage1_map.png");

	mapHeight = map1->getContentSize().height;

	map1Pos = Vec2(0 + map1->getContentSize().width / 2, 0 + mapHeight / 2);
	map2Pos = Vec2(0 + map1->getContentSize().width / 2, mapHeight + mapHeight / 2);

	map1->setPosition(map1Pos);
	map1->setColor(Color3B(0, 0, 255));
	map2->setPosition(map2Pos);

	//this->addChild(map1, 0);
	//this->addChild(map2, 0);
	initTileMap();

	//a->setPosition(Vec2(200,800));
	this->scheduleUpdate();
	return true;
}

